import Link from "next/link";
import css from "./Video.css";

const FullScreenVid = props => (
<video autoplay="" loop="" muted="" className={css.Video}>
    <source data-src="https://labs.chiedo.com/wp-content/themes/chiedolabs/vid/promo.mp4?v=2" type="video/mp4" src={props.src}/>
  </video>
);

export default Video;

